export let ModalInfo =  ["Венсан Пьер Клод Белорже - диджей, представитель французской хаус-музыки, более известен под именем Kavinsky. Вдохновением для творчества Венсана служат фильмы о зомби эпохи VHS, хип-хоп и фанк последних десятилетий XX века. Исполняет треки в стиле электронных саундтреков к фильмам 1980-х годов. Музыкальные композиции и видеоклипы Белорже повествуют о вымышленном персонаже Kavinsky - молодом человеке, который погиб в 1986 году, не справившись с управлением своего красного Ferrari Testarossa, и восстал из мёртвых 20 лет спустя, для того чтобы творить собственную электронную музыку",
"Orax является проектом итальянского музыканта Orax Dumollard. В 1995-2003 гг. он являлся гитаристом и композитором группы Xilema, а к 2010 году решил начать сольную карьеру. В 2012 самостоятельно выпустил свой первый альбом, а в феврале 2013 Orax уже был объявлен проектом недели на MTV new generation Italia.",
"Калифорнийский электронный дуэт, давший второе дыхание музыке эпохи VHS. На данный момент являются одними из самых популярных и обсуждаемых коллективов в стиле Retrowave наряду с Perturbator и Carpenter Brut.",
"«3FORCE» – трио из Санкт-Петербурга, совместный проект знаменитого drum-and-bass дуэта Gancher & Ruin и самобытного электронщика EyeScream. Отметившись множеством релизов на ведущих мировых лейблах (Position Chrome, Tainted Audio, Tympanik Audio, Blue Tunes Records), музыканты выпустили ностальгический альбом «Intergalactic», пронизанный атмосферой электронной музыки 80-х. "
];
